@Override
public int hashCode() {
  long h = 0;
  for (int i = bits.length; --i>=0;) {
    h ^= bits[i];
    h = (h << 1) | (h >>> 63); // rotate left
  }
  // fold leftmost bits into right and add a constant to prevent
  // empty sets from returning 0, which is too common.
  return (int) ((h>>32) ^ h) + 0x98761234;
}

